import './App.css';
import Header from './Components/Header/Header';
import Home from './Components/Content/Home';
import Footer from './Components/Footer/Footer';

import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  Outlet
} from "react-router-dom";

function App() {
  return (
    <div classname="App">
      <BrowserRouter>
      <Header/>
      <Route path="/" element={<Home/>}/>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
